import React, {Component} from 'react';

class Jumpin extends Component {


    render() {

        return(


<div className=" z-index-1 flex-container">




                    <div className="flex-child">
                            <h1 className="display-4 mt-8 font-w-5">
                                Project<span className="text-primary "></span> Management Consulting
                            </h1>
                            {/* Text */}
                            <p className="lead text-muted font-w-5"> For us the key to any type of project from easy ones to more challenging ventures require a solid framework to build from. Setting and meeting benchmarks are dependent on how well your project has been planned with documentation and proceses geared at ensuring your deliverable will be accepted once the project is concluded. The <a href ="https://www.pmi.org/"> Project Managment Institute</a> is a trans-national organization that has set standards and protocols for making that happen and we take it very seriously. This means clearly outlining a project management plan that will detail our process step by step.  </p>
                            </div>

                            <div className="flex-child">
                            <h1 className="display-4 mt-8 font-w-5">
                                Project Management Service Fees
                            </h1>
                            {/* Text */}
                            <p className="lead text-muted font-w-5"> There is no one-size-fits-all when it comes to project management. It is recognized and agreed upon by experts that when we discuss "project management" we're refering to a stand-alone project. Many businesses conflate operations and project management and for that reason may end up overbudget and out-of-schedule. What we provide is the opportunity to launch a project with us using a tried and true project managment methodology, or you can opt for adhoc private (phone or video) consultation(s). The latter will be priced depending on the scope of your inquery, time-limitations, and any work that has to be done on our end. If you start a project with us  we will be in constant contact and we will happily explain the processes that we employ.  With our consulting services we want to help you out of a jam and to ensure your project looks and feels right. Contact us for more information.  </p>
                            </div>

            </div>

        )
    }

}

export default Jumpin
